import React, { useState } from "react";
import "./VolunteeringDashboard.css";

const daysOfWeek = ["Pn", "Wt", "Śr", "Cz", "Pt", "So", "Nd"];
const months = [
  "Styczeń", "Luty", "Marzec", "Kwiecień", "Maj", "Czerwiec",
  "Lipiec", "Sierpień", "Wrzesień", "Październik", "Listopad", "Grudzień"
];

const VolunteeringDashboard = () => {
  const [currentDate, setCurrentDate] = useState(new Date());
  const [tasks, setTasks] = useState([]);
  const [newTask, setNewTask] = useState({ type: "", date: "" });

  const taskTypes = ["Spacer z psem", "Sprzątanie boksów", "Opieka nad zwierzętami"];

  const startOfMonth = new Date(currentDate.getFullYear(), currentDate.getMonth(), 1);
  const endOfMonth = new Date(currentDate.getFullYear(), currentDate.getMonth() + 1, 0);
  const numDays = endOfMonth.getDate();

  const addTask = () => {
    if (!newTask.type || !newTask.date) return;
    setTasks([...tasks, { ...newTask, status: "pending" }]);
    setNewTask({ type: "", date: "" });
  };

  const cancelTask = (index) => {
    const reason = prompt("Podaj powód rezygnacji:");
    if (!reason) return;
    const updated = [...tasks];
    updated[index].status = "cancelled";
    updated[index].reason = reason;
    setTasks(updated);
  };

  const changeMonth = (offset) => {
    const newDate = new Date(currentDate.getFullYear(), currentDate.getMonth() + offset, 1);
    setCurrentDate(newDate);
  };

  const formatDateString = (year, month, day) => {
    const m = month + 1; // miesiące w JS są 0-index
    const d = day;
    return `${year}-${m.toString().padStart(2, "0")}-${d.toString().padStart(2, "0")}`;
  };

  return (
    <div className="dashboard-container">
      <h2>Panel wolontariusza</h2>

      <div className="calendar-navigation">
        <button onClick={() => changeMonth(-1)}>{"<"}</button>
        <span>{months[currentDate.getMonth()]} {currentDate.getFullYear()}</span>
        <button onClick={() => changeMonth(1)}>{">"}</button>
      </div>

      <div className="calendar-grid">
        {daysOfWeek.map((d) => (
          <div key={d} className="calendar-day-header">{d}</div>
        ))}

        {/* Puste komórki przed pierwszym dniem miesiąca */}
        {Array(startOfMonth.getDay() === 0 ? 6 : startOfMonth.getDay() - 1)
          .fill(null)
          .map((_, idx) => <div key={"empty" + idx} className="calendar-day empty"></div>)}

        {/* Dni miesiąca */}
        {Array.from({ length: numDays }, (_, i) => {
          const day = i + 1;
          const dateStr = formatDateString(currentDate.getFullYear(), currentDate.getMonth(), day);
          const dayTasks = tasks.filter(t => t.date === dateStr);

          return (
            <div key={day} className="calendar-day">
              <div className="calendar-date">{day}</div>
              {dayTasks.map((task, idx) => (
                <div key={idx} className={`calendar-task ${task.status}`}>
                  {task.type} {task.status === "cancelled" && `— ${task.reason}`}
                </div>
              ))}
            </div>
          );
        })}
      </div>

      <div className="add-task-box">
        <h3>Dodaj aktywność</h3>
        <select
          value={newTask.type}
          onChange={(e) => setNewTask({ ...newTask, type: e.target.value })}
        >
          <option value="">-- wybierz --</option>
          {taskTypes.map(t => <option key={t} value={t}>{t}</option>)}
        </select>

        <input
          type="date"
          value={newTask.date}
          onChange={(e) => setNewTask({ ...newTask, date: e.target.value })}
        />

        <button className="add-btn" onClick={addTask}>Dodaj</button>
      </div>
    </div>
  );
};

export default VolunteeringDashboard;
